import { Route, Routes} from "react-router-dom";
function Info(){
    return <>hello</>
}
function AdminOrderInfo({ orders }) {
    orders&&console.log("hi");
  return (
    orders?<Routes>
      {orders.data.OrderFind.map((order) => {
        console.log(order)
        return (
          <Route
            path={"order="+order._id}
            element={<Info/>}
            key={"route" + order._id}
          />
        );
      })}
    </Routes>:<></>
  );
}
export default AdminOrderInfo;
